desc:
This wonderful apartment is just next to RMIT
2 bedrooms, 1 bathroom, with great city views;
Quality fixtures and fitting, with dishwasher, timber floor, aircons etc.;
Whole floor residence facilities, including Pool, gym, spa, steam room, 2 gaming rooms, BBQ, sundeck, mini cinema, roof top gardens etc. 
For inspection please call Sam 0433 145 188.

This furnished studio apartment is well located in one of the best locations in North Melbourne. The Royal Melbourne Hospital, University High School, Queen Victoria Market and 7-11 convenient store are just within a few minutes walk.
Features included:
- fully finished with all you need;
- kitchen with electric cooking;
- commute laundry;
- on site building manager.

Within walking distance to parklands this two bedroom unit is close to public transport, bus route 34 and both Heatherdale and Mitcham train stations. A short drive to Antonio Park Primary School and Mullauna Secondary College, local shopping, Eastland, cafe's and restaurants. Easy access to Eastlink and Maroondah Highway. Features include;
 Lounge/dining room
 Newly renovated kitchen with gas

This 3 bedroom home is located in a very central position, at the end of a no-through-road with Burwood Heights Primary School and Forest Hill Secondary College just next door. Local shopping in at Forest Hill Chase and Burwood One. Public transport within a short walk and easy access to main roads. Features include;
 Separate entrance hall
 Large formal lounge/dining room with polished
